import React, { useEffect, useState } from 'react';

const AppointmentsPage = () => {
  const [appointments, setAppointments] = useState([]);

  useEffect(() => {
   
    const savedAppointments = JSON.parse(localStorage.getItem('appointments')) || [];
    setAppointments(savedAppointments);
  }, []);

  return (
    <div className="h-full text-white p-6">
      <h2 className="text-2xl font-bold">Scheduled Appointments</h2>
      {appointments.length > 0 ? (
        appointments.map((appointment, index) => (
          <div key={index} className="mt-4 p-4 border w-1/3 bg-custombg rounded">
            <p className="text-xl">Hospital/Clinic: {appointment.name}</p>
            <p className="text-xl">Doctor: {appointment.doctor}</p>
            <p className="text-xl">Specialty: {appointment.specialty}</p>
            <p className="text-xl">Timing: {appointment.timings}</p>
            <p className="text-xl">Slot Number: {appointment.slot}</p>
          </div>
        ))
      ) : (
        <p>No appointments scheduled.</p>
      )}
    </div>
  );
};

export default AppointmentsPage;
